import React from "react";
import useFetchData from "../hooks/useFetchData";
import "./"

const OverallLanguageRank = () => {
  const { data, loading } = useFetchData();

  if (loading) return <div>Loading...</div>;

  // 데이터 정렬
  const sortedData = [...data].sort((a, b) => b.trend_score - a.trend_score);

  return (
    <div>
      <h2>Top Languages</h2>
      <ol>
        {sortedData.slice(0, 5).map((item, index) => (
          <li key={index}>
            {item.language} - Score: {item.trend_score}
          </li>
        ))}
      </ol>
    </div>
  );
};

export default OverallLanguageRank;
